import React, { useState, useEffect } from 'react';
import api from 'api';
import { getFirestore, collection, getDocs } from 'firebase/firestore';

const App = () => {
        // Global variables provided by the Canvas environment
        const firebaseConfig = typeof __firebase_config !== 'undefined' ? JSON.parse(__firebase_config) : {};

        // State to hold the master data
        const [masterData, setMasterData] = useState([]);
        // State for loading and error handling
        const [loading, setLoading] = useState(true);
        const [error, setError] = useState('');

        // State for Firestore instances
        const [db, setDb] = useState(null);

        // Initialize Firebase Firestore on component mount
        useEffect(() => {
            try {
                const app = initializeApp(firebaseConfig);
                const firestoreDb = getFirestore(app);
                setDb(firestoreDb);
            } catch (e) {
                console.error("Firebase initialization failed:", e);
                setError("Failed to initialize Firebase.");
                setLoading(false);
            }
        }, [firebaseConfig]);

        // Use a second useEffect to fetch data when db is ready
        useEffect(() => {
            const fetchMasterData = async() => {
                if (!db) return; // Wait for db to be initialized

                setLoading(true);
                setError('');

                // --- IMPORTANT: This is mock data for demonstration. ---
                // In a real application, you would fetch data from Firestore.
                // Example of how you would fetch from a 'masterdata' collection:
                /*
                try {
                  const masterDataCollection = collection(db, "masterdata");
                  const dataSnapshot = await getDocs(masterDataCollection);
                  const dataList = dataSnapshot.docs.map(doc => ({ id: doc.id, ...doc.data() }));
                  setMasterData(dataList);
                } catch (err) {
                  console.error("Error fetching master data:", err);
                  setError("Failed to fetch data from the database.");
                }
                */

                // Using mock data based on previous conversations
                const mockData = [
                    { id: '1', department: 'Biological Input Supply', item: 'Fertilizer A', unit: 'kg' },
                    { id: '2', department: 'Chemical Input Supply', item: 'Pesticide X', unit: 'liter' },
                    { id: '3', department: 'Biological Input Supply', item: 'Seedlings', unit: 'piece' },
                    { id: '4', department: 'Chemical Input Supply', item: 'Herbicide Y', unit: 'liter' },
                ];

                setMasterData(mockData);
                setLoading(false);
            };

            fetchMasterData();
        }, [db]); // Re-run effect when the db instance is available

        return ( <
            div className = "min-h-screen bg-gray-50 p-6 sm:p-10" >
            <
            div className = "max-w-7xl mx-auto" >
            <
            header className = "mb-8" >
            <
            h1 className = "text-4xl font-extrabold text-gray-900 mb-2" > Master Data < /h1> <
            p className = "text-lg text-gray-600" > Manage and view core data
            for the application. < /p> < /
            header >

            {
                error && < div className = "bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded-lg mb-4"
                role = "alert" > { error } < /div>}

                <
                div className = "bg-white rounded-xl shadow-lg overflow-hidden" > {
                    loading ? ( <
                        div className = "p-6 text-center text-gray-500" > Loading master data... < /div>
                    ) : ( <
                        div className = "overflow-x-auto" >
                        <
                        table className = "min-w-full divide-y divide-gray-200" >
                        <
                        thead className = "bg-gray-50" >
                        <
                        tr >
                        <
                        th className = "px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider" > Department < /th> <
                        th className = "px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider" > Item < /th> <
                        th className = "px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider" > Unit < /th> < /
                        tr > <
                        /thead> <
                        tbody className = "bg-white divide-y divide-gray-200" > {
                            masterData.map((data) => ( <
                                tr key = { data.id } >
                                <
                                td className = "px-6 py-4 whitespace-nowrap text-sm font-medium text-gray-900" > { data.department } < /td> <
                                td className = "px-6 py-4 whitespace-nowrap text-sm text-gray-500" > { data.item } < /td> <
                                td className = "px-6 py-4 whitespace-nowrap text-sm text-gray-500" > { data.unit } < /td> < /
                                tr >
                            ))
                        } <
                        /tbody> < /
                        table > <
                        /div>
                    )
                } <
                /div> < /
                div > <
                /div>
            );
        };

        export default App;
